import React from 'react';

import './App.css';
import Navbar from './components/Navbar'
import Slider from './components/slider/Slider';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

const App = () =>{
return (

  <Router>
  <Navbar />
  <Switch>
    <Route path="/" exact components={Home} />
  </Switch>
  </Router>
  
  );
}

{/* <Slider />  */}

export default App
